import React from "react";
import Header from "./Header";
import { Outlet } from "react-router-dom";
import Footer from "./Footer";

function HomeLayout() {
  return (
    <>
      <div style={{ backgroundColor: "black" }}>
        <Header />
        <Outlet />
        <Footer />
      </div>
    </>
  );
}

export default HomeLayout;
